// Função para expandir dados compactos
function expandProvider(compact: CompactProvider): NetworkProvider {
  return {
    name: compact[0],
    type: compact[1],
    address: compact[2],
    neighborhood: compact[3],
    city: compact[4],
    phone: compact[5],
    specialties: compact[6],
  };
}

// Função para obter prestadores por produto
export function getProvidersByProduct(productId: string): NetworkProvider[] {
  const compact = COMPACT_DATA[productId] || [];
  return compact.map(expandProvider);
}

