export function searchProviders(
  productId: string,
  query: string,
  filters?: {
    city?: string;
    neighborhood?: string;
    type?: string;
    specialty?: string;
  }
): NetworkProvider[] {
  let providers = getProvidersByProduct(productId);
  
  if (query) {
    const lowerQuery = query.toLowerCase();
    providers = providers.filter(p => 
      p.name.toLowerCase().includes(lowerQuery) ||
      p.neighborhood.toLowerCase().includes(lowerQuery) ||
      p.specialties.some(s => s.toLowerCase().includes(lowerQuery))
    );
  }
  
  if (filters?.city) {
    providers = providers.filter(p => 
      p.city.toLowerCase().includes(filters.city!.toLowerCase())
    );
  }
  
  if (filters?.neighborhood) {
    providers = providers.filter(p => 
      p.neighborhood.toLowerCase().includes(filters.neighborhood!.toLowerCase())
    );
  }
  
  if (filters?.type) {
    providers = providers.filter(p => 
      p.type.toLowerCase().includes(filters.type!.toLowerCase())
    );
  }
  
  if (filters?.specialty) {
    providers = providers.filter(p => 
      p.specialties.some(s => s.toLowerCase().includes(filters.specialty!.toLowerCase()))
    );
  }
  
  return providers;
}

// Função para obter especialidades únicas de um produto
export function getUniqueSpecialties(productId: string): string[] {
  const providers = getProvidersByProduct(productId);
  const specialties = new Set<string>();
  providers.forEach(p => p.specialties.forEach(s => specialties.add(s)));
  return Array.from(specialties).sort();
}

// Função para obter tipos de estabelecimento únicos
export function getUniqueTypes(productId: string): string[] {
  const providers = getProvidersByProduct(productId);
  const types = new Set<string>();
  providers.forEach(p => {
    if (p.type) types.add(p.type);
  });
  return Array.from(types).sort();
}

// Função para obter bairros únicos
export function getUniqueNeighborhoods(productId: string): string[] {
  const providers = getProvidersByProduct(productId);
  const neighborhoods = new Set<string>();
  providers.forEach(p => {
    if (p.neighborhood) neighborhoods.add(p.neighborhood);
  });
  return Array.from(neighborhoods).sort();
}

// Lista de produtos com rede disponível
export function getProductsWithNetwork(): string[] {
  return Object.keys(COMPACT_DATA).filter(k => COMPACT_DATA[k].length > 0);
}

// Contagem de prestadores por produto
export function getProviderCount(productId: string): number {
  return (COMPACT_DATA[productId] || []).length;
}
